import Card from "./Card";
import "./ErrorModal.css";
const Error = (props) => {
  return (
    <div>
      <div className="backdrop"></div>
      <Card className="modal">
        <header className="header">
          <h2>{props.title}</h2>
        </header>
        <div className="content">
          <p>{props.message}</p>
        </div>
        <footer className="actions">
          <button>Okay</button>
        </footer>
      </Card>
    </div>
  );
};
export default Error;
